INSERT INTO `v1_b14c03a51b9f17919ac8a928a029ffe76b7fe4b6f39735d36453582997bff871` VALUES (104411, 0.5, 0, "これ、お主たち。\nシノブの誕生日じゃというのに、\nお返しの話題で盛り上がるでないわ。\nまったく、こやつらは……", 10, 1, 0, 31114, 1, 31114091, 11);
